def partition(pointlist, l, r, ax):
    # here, pointlist refers to the source list, while l and r are the left and right bounds, also, ax refers to the index of the axis wrt which the partition will happen
    # this function will retrun the partitioned list (all the elements to the left of the pivot will be smaller trhan the pivot and all those to the right of the pivot will be greater than it)
    last = pointlist[r]
    i = l
    j = l
    while (j < r) :
        if (pointlist[j][ax] < last[ax]) :
            pointlist[i], pointlist[j] = pointlist[j],pointlist[i];
            i += 1
        j += 1
    pointlist[i], pointlist[r] = pointlist[r],pointlist[i];
    return i

def findMid(pointlist, l, r, ax):
    # pointlist is the set of data points whose middle has to be found, while ax is the axis wrt which the median has to be found
    # also, l and r are the indices within wbich the median has to be found 
    if len(pointlist) == 0:
        return None
    rel_ind = partition(pointlist, l, r, ax)
    # this will be the index of the partition
    if rel_ind == len(pointlist)//2:
        return rel_ind
    elif rel_ind < len(pointlist)//2:
        return findMid(pointlist, rel_ind+1, r, ax)
    elif rel_ind==0:
        return 0
    else:
        return findMid(pointlist, l, rel_ind-1, ax)

