def mergeSortAxis(L, ax):
    # here, L is the input list to be sorted and ax refers to the axis it has to be sorted wrt
    # time complexity: O(nlogn)
    if len(L) > 1:
        mid = len(L)//2
        Left = L[:mid]
        Right = L[mid:]
        # array elements have been divided into the left and right halves 
        # Sort the first half
        mergeSortAxis(Left, ax)
        # Sort the second half
        mergeSortAxis(Right, ax)
        i = j = k = 0
 
        # Copy data to temp arrays L[] and R[]
        while i < len(Left) and j < len(Right):
            if Left[i][ax] <= Right[j][ax]:
                L[k] = Left[i]
                i += 1
            else:
                L[k] = Right[j]
                j += 1
            k += 1
        # Checking if any element was left
        while i < len(Left):
            L[k] = Left[i]
            i += 1
            k += 1
        while j < len(Right):
            L[k] = Right[j]
            j += 1
            k += 1
    return L

