class Node:

    def __init__(self, value):
        self.value = value 
        self.left = None 
        self.right = None 
        self.tree = None
        self.isLeaf = False

def binSearch(points_y, y_min, y_max):
    # this function counts the no. of points that are in the given range present in the sorted list 
    # it then returns a list of these points
    ans = []
    l = len(points_y)
    if l == 0:
        return ans
    elif l == 1:
        if y_min<=points_y[0][1] and y_max>=points_y[0][1]:
            ans.append(points_y[0])
        return ans
    else:
        # this is the most general case when the list has multiple elements 
        mid = l//2 
        if points_y[mid][1]<y_min:
            return binSearch(points_y[mid+1:], y_min, y_max)
        elif points_y[mid][1] > y_max:
            return binSearch(points_y[:mid], y_min, y_max)
        else:
            # this is the case in which the middle point lies in the given given range 
            ans.append(points_y[mid])
            ans = ans + binSearch(points_y[mid+1:], y_min, y_max) + binSearch(points_y[:mid], y_min, y_max)
            return ans 

def maintainOrder(sorted_y, middle, toggle):
    # this function will maintain the order of y while partitioning it from mid 
    # toggle == 0 implies [:mid]
    # toggle == 1 implies [mid+1:]
    ans = []
    if not sorted_y:
        return ans
    elif toggle==0:
        for i in range(0, len(sorted_y)):
            if sorted_y[i][0] < middle[0]:
                ans.append(sorted_y[i])
            i = i+1
        return ans
    else:
        for i in range(0, len(sorted_y)):
            if sorted_y[i][0] > middle[0]:
                ans.append(sorted_y[i])
            i = i+1
        return ans

def buildTwoTree(sorted_x, sorted_y):
    tree = sorted_y
    if len(sorted_x) == 1:
        v = Node(sorted_x[0])
        v.isLeaf = True
        v.tree = tree
    elif len(sorted_x) == 0:
        v = None
    else:
        mid = len(sorted_x)//2
        v = Node(sorted_x[mid])
        middle = sorted_x[mid]
        v.left = buildTwoTree(sorted_x[:mid], maintainOrder(sorted_y, middle, 0))
        v.right = buildTwoTree(sorted_x[mid+1:], maintainOrder(sorted_y, middle, 1))
        v.tree = tree
    return v

def findSplit(root, x_min, x_max, ax):
    # this function finds the node at which the search paths for finding x_min and x_max diverge
    splitNode = root    # by default, the paths for finding them diverge at the root
    while splitNode != None:
        node = splitNode.value  # this stores the value of the split node, helps in fast comparison
        if x_max < node[ax]:
            splitNode = splitNode.left  #if x_max is less than the value, then x_min will also be less than the value, so they both will follow the same path
        elif x_min > node[ax]:
            splitNode = splitNode.right
        else:
            break   #in this case, the split is found, the loop will therefore break and return the current node 
    return splitNode


class PointDatabase:
# this range tree will be used for lookups once it has been made
# so, the data structure will be immutable in this case

    def __init__(self, pointlist):
        sorted_x = mergeSortAxis(pointlist, 0)
        sorted_y = mergeSortAxis(pointlist.copy(), 1)
        # this must run in time O(nlogn)
        # now, maybe sort pointlist according to x coordinates and y coordinates using algo with time complexity O(nlogn)
        # for this, we use mergesort, which takes O(nlogn) time. We;ve defined a helper function called mergeSortAxis() for this
        # a helper function buildTwoTree will have to be defined 
        self.root = buildTwoTree(sorted_x, sorted_y)

    def searchNearby(self, q, d):
        # this will return the list of all points that are in the square with side 2d centered around the query point q
        """
        ALGORITHM:
        1. if the given range is [x1, x2] and [y1, y2], start by searching for x1 and x2
        2. Now, the search paths will diverge at some node, let this be 'split'. This node will lie in b/w the two x values 
        3. Now, if this node is a leaf node, simply add it to the list and return the list 
        4. However, if the node is not a leaf node, then more than one points have to be checked 
        5. In such a case, we simply do a 1d range search on the y-sorted list associated with that node 
        6. we also check if the given node is in the required ranges
        """
        ans = []
        x_min = q[0]-d
        x_max = q[0]+d
        y_min = q[1]-d
        y_max = q[1]+d
        # have defined the boundary values of the range
        split = findSplit(self.root, x_min, x_max, 0)  # the split node for x_min and x_max wrt x axis is found 
        #print(f"split: {split.value}")
        if not split:
            # trivial case
            return ans 
        elif split.isLeaf:
            # if split is a leaf, we know that there are no more values in the given range here. So we simply check is split is in range 
            if y_min<=split.value[1] and y_max>=split.value[1]:
                ans.append(split.value)
            return ans
        else:
            # checking to see if split itself is in the list 
            if y_min<=split.value[1] and y_max>=split.value[1]:
                ans.append(split.value)

            # in the more general case, we assign v the value of the left child of split 
            if split.left:
                v = split.left
                while not v.isLeaf:
                    #print(f"v_value_l: {v.value}")
                    if y_min <= v.value[1] and y_max>=v.value[1] and x_min <=v.value[0] and x_max>=v.value[0]:
                        ans.append(v.value)
                    if x_min <= v.value[0]:
                        if v.right:
                            ans = ans + binSearch(v.right.tree, y_min, y_max)
                        if v.left:
                            v = v.left  # we will now go to the left child of v since it might still have elements that are greater than x_min
                        else:
                            break
                    elif v.right:
                        v = v.right # this means that the values of the left subtree are too less, it will therefore move to the right subtree   
                    else:   # if v.right does not exist, it can simply break from the loop
                        break 
                if y_min <= v.value[1] and y_max>=v.value[1] and x_min <=v.value[0] and x_max>=v.value[0]:
                    ans.append(v.value)
            # after traversing the left subtree of the split node
            # we traverse the right subtree of the node in a symmetric fashion
            if split.right:
                v = split.right
                while not v.isLeaf:
                    #print(f"v_value_r: {v.value}")
                    if y_min <= v.value[1] and y_max>=v.value[1] and x_min <=v.value[0] and x_max>=v.value[0]:
                        ans.append(v.value)
                    if x_max >= v.value[0]:
                        if v.left:
                            ans = ans + binSearch(v.left.tree, y_min, y_max)
                        if v.right:
                            v = v.right
                        else:
                            break
                    elif v.left:
                        v = v.left
                    else:
                        break
                if y_min <= v.value[1] and y_max>=v.value[1] and x_min <=v.value[0] and x_max>=v.value[0]:
                    ans.append(v.value)
            if len(ans)>1 and (ans[-2][0] == ans[-1][0]) and (ans[-2][1] == ans[-1][1]):
                ans.pop()
            return ans


